Defendant Cristal T Latham in court with attorney Joseph Smith.  Jayne Davis Dewire appeared for the State of Wisconsin. Defendant pleas no contest as to counts 1 and 2 and strike the repeater enhancer and the remainer counts (3 thru 10) are dismissed and read-in. The court imposed the following sentence: 

  The Defendant was sentenced to the following:

IMPOSED SENTENCE of: COUNTS 1 AND 2, concurrent with each other, but consecutive to present sentence

6 YEARS IMPRISONMENT
  -  2 YEAR(S) OF INITIAL CONFINEMENT
  -  4 YEAR(S) OF EXTENDED SUPERVISION;

CONDITIONS OF EXTENDED SUPERVISION:  

*Follow through with any treatment and/or counseling recommended by Agent;
*No contact with:  the victim or any of the businesses listed in the complaint
*DNA sample to be provided if not yet previously done.
 
RESTITUTION:  $165.00 to the victim (to be paid as a condition of extended supervision - restitution to be paid before costs or fines);

FINE or COURT COSTS:  $268.00 each count  (to be paid as a condition of extended supervision);

DNA SURCHARGE:  $250.00 ech count (to be paid as a condition of extended supervision);

Defendant is eligible for Challenge Incarceration Program.
Defendant is  not eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given.
